// SPDX-License-Identifier: SEE LICENSE IN LICENSE
pragma solidity ^0.8.9;

import "../lib/openzeppelin-contracts/contracts/token/ERC20/IERC20.sol";
import "./Interfaces/IUniswapV3Factory.sol";
import "./Interfaces/IUniswapV3PoolState.sol";
import "./Interfaces/IV3SwapRouter.sol";
import "./liberaries/IFullMathLib.sol";
import "./liberaries/ITickMathLib.sol";

contract IndexStrat {
    address public owner;

    address public fullMath;
    address public tickMath;

    address public depositToken;
    address[] public tokens;
    uint256[] public allocations;
    uint24[] public swapFees;
    address public router;
    address public factory;

    constructor(
        address _depositToken,
        address[] memory _tokens,
        uint256[] memory _allocations,
        uint24[] memory _swapFees
    ) {
        owner = msg.sender;
        depositToken = _depositToken;
        router = 0x68b3465833fb72A70ecDF485E0e4C7bD8665Fc45;
        fullMath = 0x19F51834817708F2da9Ac7D0cc3eAFF0b6Ed17D7;
        tickMath = 0x642e8455F280d1F5f252DFFE0A264810A80A7DF7;
        factory = 0x1F98431c8aD98523631AE4a59f267346ea31F984;

        for (uint i = 0; i < _tokens.length; i++) {
            tokens.push(_tokens[i]);
            allocations.push(_allocations[i]);
            swapFees.push(_swapFees[i]);
        }
        giveAllowence();
    }

    function deposit(uint256 _amount) public {
        require(msg.sender == owner, "You are not the owner");
        IERC20(depositToken).transferFrom(msg.sender, address(this), _amount);
        _deposit();
    }

    function _deposit() internal {
        uint256 balance = IERC20(depositToken).balanceOf(address(this));
        uint256 depo;
        for (uint256 i = 0; i < tokens.length; i++) {
            depo = (balance * (allocations[i])) / 100;
            _swapV3In(depositToken, tokens[i], depo, swapFees[i]);
        }
    }

    function withdraw(address _reci, uint256 _amount) public {
        require(msg.sender == owner, "You are not the owner");
        uint256 withT;
        for (uint i = 0; i < tokens.length; i++) {
            withT = tokenAToTokenBConversion(
                depositToken,
                tokens[i],
                swapFees[i],
                ((_amount * allocations[i]) / 100)
            );
            _swapV3In(tokens[i], depositToken, withT, swapFees[i]);
        }
        uint256 balanceD = IERC20(depositToken).balanceOf(address(this));
        if (balanceD < _amount) {
            _amount = balanceD;
        }

        IERC20(depositToken).transfer(_reci, _amount);
    }

    function closeAll() internal {
        uint256 totalBal;
        for (uint256 i = 0; i < tokens.length; i++) {
            totalBal = IERC20(tokens[i]).balanceOf(address(this));
            _swapV3In(tokens[i], depositToken, totalBal, swapFees[i]);
        }
    }

    function rebalance() public {
        require(msg.sender == owner, "You are not owner");
        closeAll();
        _deposit();
    }

    function balanceOf() public view returns (uint256) {
        uint256 balance;
        for (uint i = 0; i < tokens.length; i++) {
            balance =
                balance +
                tokenAToTokenBConversion(
                    tokens[i],
                    depositToken,
                    swapFees[i],
                    IERC20(tokens[i]).balanceOf(address(this))
                );
        }

        return balance;
    }

    function _swapV3In(
        address tokenIn,
        address tokenOut,
        uint256 amountIn,
        uint24 fee
    ) internal returns (uint256 amountOut) {
        amountOut = IV3SwapRouter(router).exactInputSingle(
            IV3SwapRouter.ExactInputSingleParams(
                tokenIn,
                tokenOut,
                fee,
                address(this),
                amountIn,
                0,
                0
            )
        );
    }

    function tokenAToTokenBConversion(
        address tokenX,
        address tokenY,
        uint24 xToyFees,
        uint256 amount
    ) public view returns (uint256) {
        address uPool = IUniswapV3Factory(factory).getPool(
            tokenX,
            tokenY,
            xToyFees
        );
        (, int24 tick, , , , , ) = IUniswapV3PoolState(uPool).slot0();
        return getQuoteAtTick(tick, uint128(amount), tokenX, tokenY);
    }

    function getQuoteAtTick(
        int24 tick,
        uint128 baseAmount,
        address baseToken,
        address quoteToken
    ) public view returns (uint256 quoteAmount) {
        uint160 sqrtRatioX96 = ITickMathLib(tickMath).getSqrtRatioAtTick(tick);

        // Calculate quoteAmount with better precision if it doesn't overflow when multiplied by itself
        if (sqrtRatioX96 <= type(uint128).max) {
            uint256 ratioX192 = uint256(sqrtRatioX96) * sqrtRatioX96;
            quoteAmount = baseToken < quoteToken
                ? IFullMathLib(fullMath).mulDiv(ratioX192, baseAmount, 1 << 192)
                : IFullMathLib(fullMath).mulDiv(
                    1 << 192,
                    baseAmount,
                    ratioX192
                );
        } else {
            uint256 ratioX128 = IFullMathLib(fullMath).mulDiv(
                sqrtRatioX96,
                sqrtRatioX96,
                1 << 64
            );
            quoteAmount = baseToken < quoteToken
                ? IFullMathLib(fullMath).mulDiv(ratioX128, baseAmount, 1 << 128)
                : IFullMathLib(fullMath).mulDiv(
                    1 << 128,
                    baseAmount,
                    ratioX128
                );
        }
    }

    function giveAllowence() internal {
        IERC20(depositToken).approve(router, type(uint256).max);
        for (uint256 i = 0; i < tokens.length; i++) {
            IERC20(tokens[i]).approve(router, type(uint256).max);
        }
    }
}

